// pages/camera/camera.js
Page({

  /**
   * 页面的初始数据
   */
  data: {
    cameraSelected: "back",
    recording: false,

    tempMedia: "",
    albumIcon: "data:image/svg+xml;base64,",
    switchIcon: "data:image/svg+xml;base64,",
    backIcon: "data:image/svg+xml;base64,",
  },

  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
    this.ctx = wx.createCameraContext();
    console.log(this.ctx)
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function () {

  },

  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {

  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function () {

  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function () {

  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function () {

  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function () {

  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function () {

  },
  //--------------------
  //拍照/摄像函数组
  shot: function(e){
    //this.ctx.stopRecord({
      //complete: () => {
        console.log("拍照时stopRecord完成")
        this.ctx.takePhoto({
          success: (res) => {
            this.setData({
              tempMedia: res.tempImagePath
            });
            console.log(this.data.tempMedia);
          },
          fail(){
            console.log("拍照失败")
          }
        });
      //}
    //})
  },

  recordStart: function(e){
    let that = this;
    //this.ctx.stopRecord({
      //complete: () => {
        this.ctx.startRecord({
          success(){
            that.setData({recording:true})
            console.log("开始录像")
            console.log(that.data.recording)
          },
          fail(){
            console.log("开启录像失败")
          }
        });  
      //}
    //});
  },

  recordEnd: function(e){
    console.log("touchEnd触发")
    console.log(this.data.recording)
    if (this.data.recording == true){
      console.log("成功进入")
      this.ctx.stopRecord({
        compressed: false,
        success: (res) => {
          console.log("录像完成");
          this.setData({
            tempMedia: res.tempThumbPath,
            recording: false
          });
        },
        fail: () => {
          console.log("录像失败")
          this.setData({recording: false});
        },
      });
    }
  },

  //--------------------

  back: function(e){
    wx.navigateBack({
      delta: 0,
    })
  },

  callAlbum: function(e){
    wx.chooseMedia({
      mediaType: "mix",
      sourceType: "album",
      maxDuration: 60,
    })
  },

  switchCamera: function(e){
    const now = this.data.cameraSelected;
    let newCam = (now == "back") ? "front" : "back";
    this.setData({
      cameraSelected: newCam
    })
  }

})